		C4C8909008C6497F000E7EEE /* gsl_regr.test.cc */ = {isa = PBXFileReference; comments = "Next steps\n\n\t* estimate the slope as a mixture, with one as white and other as 0\n\n\t* plug into sequential regression object.  Seems that the improved GSL code should\n\t  allow for a simpler external framework.  Most is already in the GSL now.\n\n\t* use revised code for vector Z for bennett things (currently just z_0)\n\n\t* use the Accelerate framework, or at least their cblas lib\n\n\n(1) Use permuted index to read/write data from arbitrary iterator into GSL form.\n(2) Merge code so that same routines used to add 1 or more predictors.\n(3) Use symmetry in evaluating new predictors Z (but hold XtX dense still)\n(4) Fit holds partial fit during modeling, and expands to all when predicting\n(5) Code for White variance uses portions of the OLS evaluation.\n(6) Use GSL F distribution for p-values\n(7) Big change.  Switch to QR factorization for all calculations. \n(8) Add GSL based routine to factor only new portions of X rather than whole array."; fileEncoding = 30; lastKnownFileType = sourcecode.cpp.cpp; path = gsl_regr.test.cc; sourceTree = "<group>"; };
